import React from 'react';

const TitleTextButton = (props) => {
    return (
        <div className="DI_HP_SubCompo_Wrapper" style={{backgroundColor: props.bgColor}}>
            <div className="DI_HP_SubCompo_Title" 
                style={{
                fontSize: props.titleFontSize,
                lineHeight: props.LineHeight,
                letterSpacing: props.letterSpacing
             }}>
                {props.title}
            </div>
            <div className="DI_HP_SubCompo_Text">
                {props.text}
            </div>
            <div className="DI_HP_SubCompo_Button">
                {props.btnText}
            </div>
        </div>
    )
}
